import { Route, Switch, Redirect } from 'react-router-dom';
import About from './pages/About';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <Route path='/' exact >
          <Redirect to='/home' />
      </Route>
      <Route path='/home'>
        <Home />
      </Route>
      <Route path='/About' >
        <About />
      </Route>
    </div>
  );
}

export default App;
